PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE IF NOT EXISTS "stocks" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "url" varchar, "buy_percent" decimal(4,2), "sell_percent" decimal(4,2), "max_price" decimal(6,2), "min_price" decimal(6,2), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "status" varchar DEFAULT 'O', "buy_target" decimal(6,2), "sell_target" decimal(6,2), "volume" decimal(6,2), "beta" decimal(3,2), "cost" decimal(6,2), "qty" integer, "buy_spread" integer, "sell_spread" integer, "available_qty" integer);
CREATE TABLE IF NOT EXISTS "items" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "desc_en" varchar, "desc_th" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "factsheets" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "item_id" integer, "figure1" decimal(9,2), "figure2" decimal(9,2), "figure3" decimal(9,2), "figure4" decimal(9,2), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "sales" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "fm_date" date, "to_date" date, "days" integer, "fm_price" decimal(6,2), "to_price" decimal(6,2), "diff" decimal(5,2), "pct" decimal(5,2), "ttl_spread" integer, "avg_spread" integer, "max_price" decimal(6,2), "min_price" decimal(6,2), "qty" bigint, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "latest_date_id" integer);
CREATE TABLE `D2016-03-17` (
	`id`	,
	`name`	,
	`fm_date`	,
	`to_date`	,
	`days`	,
	`fm_price`	,
	`to_price`	,
	`diff`	,
	`pct`	,
	`ttl_spread`	,
	`avg_spread`	,
	`max_price`	,
	`min_price`	,
	`qty`	,
	`created_at`	,
	`updated_at`	
);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "latest_dates" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "date" date, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "profits" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "quarter" varchar, "latest_profit" integer, "previous_profit" integer, "inc_profit" integer, "inc_percent" decimal(6,2), "year" integer);
CREATE TABLE IF NOT EXISTS "consensus" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar, "price" decimal, "buy" integer, "hold" integer, "sell" integer, "eps_a" decimal, "eps_b" decimal, "pe" decimal, "pbv" decimal, "yield" decimal, "consensus_price" decimal, "status" varchar, "stock_id" integer);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE INDEX "index_factsheets_on_item_id" ON "factsheets" ("item_id");
CREATE UNIQUE INDEX "index_consensus_on_name" ON "consensus" ("name");
CREATE UNIQUE INDEX "index_profits_on_name_and_year_and_quarter" ON "profits" ("name", "year", "quarter");
COMMIT;
